script: |
  super -f text -I q11823.spq | sort > q11823.out

inputs:
  - name: q11823.spq
    data: |
      SELECT ALL - - col2 / - - col0 AS col2 FROM tab0 (FORMAT parquet) WHERE - col1 + - 31 NOT BETWEEN - - col2 AND + 90 / - + col2;
  - name: tab0

outputs:
  - name: q11823.out
    data: |
      0
      1
      3
